struct Vector { public int X; public int Y; };

Vector Move(Vector position, char move)
{
	switch (move)
	{
		case 'U':
			return new Vector { X = position.X, Y = Math.Max(0, position.Y - 1) };
		case 'D':
			return new Vector { X = position.X, Y = Math.Min(keypad[0].Length - 1, position.Y + 1) };		
		case 'L':
			return new Vector { X = Math.Max(0, position.X - 1), Y = position.Y };
		case 'R':
			return new Vector { X = Math.Min(keypad[0].Length - 1, position.X + 1), Y = position.Y };
		default:	
			throw new ArgumentOutOfRangeException(nameof(move), move, "Must be one of: U, D, L, R");
	}
}

static int[][] keypad = new[] {
	new[] { 1, 2, 3 },
	new[] { 4, 5, 6 },
	new[] { 7, 8, 9 }
};

const string testInput = @"ULL
RRDDD
LURDL
UUUUD";

const string realInput = @"



";

static string[] moveLists = realInput.Split(new[] { "\r\n" }, StringSplitOptions.RemoveEmptyEntries);

void Main()
{
	string.Join
	(
		"",
		moveLists.Aggregate
		(
			new[] { new Vector { X = 1, Y = 1 } },
			(positions, moveList)
				=> 	positions.Concat
					(
						new[]
						{
							moveList.Aggregate
							(
								positions.Last(),
								(position, move) => Move(position, move)
							)
						}
					)
					.ToArray()				
		)
		.Skip(1)
		.Select(position => keypad[position.Y][position.X])
	)
	.Dump();

	// 36629?
}
